import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Hero from './components/Hero';
import Highlights from './components/Highlights'
import Footer from './components/Footer';
import $ from 'jquery';
import CookieConsent from "react-cookie-consent";

export default class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      foo: 'bar',
      resumeData: {}
    };

  }

  getResumeData(){
    $.ajax({
      url:'/resumeData.json',
      dataType:'json',
      cache: false,
      success: function(data){
        this.setState({resumeData: data});
      }.bind(this),
      error: function(xhr, status, err){
        console.log(err);
        alert(err);
      }
    });
  }

  componentDidMount(){
    this.getResumeData();
  }
 render(){
   return(
     <div>
      <CookieConsent
        location="top"
        buttonText="Got it"
        style={{ backgroundColor: '#F2F2F2', color:'black'}}
        buttonStyle={{ marginRight:"500px",borderRadius:"5px", paddingLeft:"15px", paddingRight:"15px", backgroundColor: "#007bc1", color:'white',fontSize: "18px;" }}
        expires={150}>
        <center><div style={{ width: "720px",marginLeft:"500px" }}>By accessing and using this website, you acknowledge that you have read and
          understand our {" "}
          <span style={{ color: "#4A55EB" }}>
          Cookie Policy, Privacy Policy, </span>{" "}
          and our {" "}
          <span style={{ color: "#4A55EB" }}>Terms of Service.</span>
          </div>
        </center>
    </CookieConsent>
       <Hero data={this.state.resumeData.data} />
       <Highlights/>
       <Footer/>
     </div>
   )
 }
}
